import React from "react";
import "./NewRegistration.css";
import "https://unpkg.com/ionicons@7.1.0/dist/ionicons/ionicons.esm.js";
import "https://unpkg.com/ionicons@7.1.0/dist/ionicons/ionicons.js";
import logo from "./images/new_лого.png"

const NewRegistration = () => {

    const type = ['Login', 'Registration'];

    let oneType = type[0];

    const myStyle = {
        height : 540
    }
    const Header = () => {
        return (
            <header>
                <img src={logo} alt={"logotype"}/>
                <nav className="navigation">
                    <a href="https://ionic.io/ionicons">Home</a>
                    <a href="#">About</a>
                    <a href="#">Services</a>
                    <a href="#">Contact</a>
                    <button className="btnLogin-popup" onClick={clicked}>Login</button>
                </nav>
            </header>
        );
    }

    const FormItem = (props) => {
        return (
            <div className="input-box">
                <span className="icon">
                    <ion-icon name={props.iconName}></ion-icon>
                </span>
                <input type="email" required />
                <label>{props.labelName}</label>
            </div>
        );
    }

    const RememberLogIn = () => {
        if (oneType === type[0]) {
            return (
                <div className="remember-forgot">
                    <label>
                        <input type="checkbox" />
                        Remember me
                    </label>
                    <a href="#">Forgot password?</a>
                </div>
            );
        } else {
            return (
                <div className="remember-forgot">
                    <label>
                        <input type="checkbox" />
                    </label>
                    I'm agree to the terms & conditions
                    <a href="#"></a>
                </div>
            );
        }

    }

    const clicked = () => {
        if (oneType === type[0]) {
            return (
                <React.Fragment>
                    <div className="wrapper">
                    <span className="icon-close">
                        <ion-icon name="close"></ion-icon>
                    </span>
                        <div className="form-box">
                            <h2>{type[0]}</h2>
                            <form>
                                <FormItem iconName={"mail"} type={"email"} labelName={"Login"}/>
                                <FormItem iconName={"lock-closed"} type={"password"} labelName={"Password"} />
                                <RememberLogIn />
                                <button type="submit" className="btn">Login</button>
                                <div className="login-register">
                                    <p>
                                        Don't have an account?
                                        <br/>
                                        <a href="#" className="register-link">
                                            Register
                                        </a>
                                    </p>
                                </div>
                            </form>
                        </div>
                    </div>
                </React.Fragment>
            );
        } else {
            return (
                <React.Fragment>
                    <div className="wrapper" style={myStyle}>
                    <span className="icon-close">
                        <ion-icon name="close"></ion-icon>
                    </span>

                        <div className="form-box">
                            <h2>{type[1]}</h2>
                            <form>
                                <FormItem iconName={"person"} type={"text"} labelName={"Username"}/>
                                <FormItem iconName={"mail"} type={"email"} labelName={"Login"}/>
                                <FormItem iconName={"lock-closed"} type={"password"} labelName={"Password"} />
                                <RememberLogIn />
                                <button type="submit" className="btn">Register</button>
                                <div className="login-register">
                                    <p>
                                        Already have an account?
                                        <br/>
                                        <a href="#" className="register-link">
                                            Login
                                        </a>
                                    </p>
                                </div>
                            </form>
                        </div>
                    </div>
                </React.Fragment>
            );
        }

        console.log('работает!', oneType);
    }
    return(
        <Header />
    );
}

export default NewRegistration;
